import React from "react";

const NoteCard = ({ note }) => {
    return (
        <div className="card shadow-sm mb-4">
            <div className="card-body">
                <h5 className="card-title">{note.title}</h5>
                <p className="card-text">{note.content}</p>
            </div>
        </div>
    );
};

export default NoteCard;
